import styled from 'styled-components';

const Logo = () => {
    const Logo = styled.span`
    font-family: 'Monofett', cursive;
    font-size:24px;
    text-align:center;
    color: #000;
    `
    return <Logo>
        Jobify
    </Logo>
}

export default Logo
